import ExpenseItem from "./components/ExpenseItem";
import Test1 from "./components/Test1";




function App() {
  const stuff = ['stuff', 'Laundry', 'cooking']
  return (
    <div>
      <h1>Let's get started!</h1>
      <ExpenseItem />
      <Test1 stuff={stuff}></Test1>
    </div>
  );
}
// or you can do it like this 
